column8:
新商品
SIXTH SENSE製ホイール セブンデュアルフェイス。<br>
1ピースならではのリムまで伸びる足長デザインを採用！<br>
ブラック×ポリッシュのコンビネーションカラーは<br>
どのボディーカラーにもマッチします。<br>
「シックスセンス製キャリパーカバー」にも対応しています。<br>
【20アルファード/ヴェルファイア2WDの装着例】<br>
■フロント<br>
・20×9.0＋インセット35<br>
・タイヤ235/35R20<br>
■リア<br>
・20×9.5＋インセット35<br>
・タイヤ245/35R20<br><style type="text/css">
